import React, { useRef, useEffect, useState } from "react";
import { Effect } from "../../utils/Particle";
import { authModalState } from "@/atoms/authModalAtom";
import AuthModal from "@/components/Modals/AuthModal";
import Navbar from "@/components/Navbar/Navbar";
import { useAuthState } from "react-firebase-hooks/auth";
import { auth } from "@/firebase/firebase";
import { useRecoilValue } from "recoil";
import { useRouter } from "next/router";

type AuthPageProps = {};

const AuthPage: React.FC<AuthPageProps> = () => {
  const [user, loading, error] = useAuthState(auth);
  const [pageLoading, setPageLoading] = useState(true);
  const router = useRouter();
  const canvasRef = useRef<HTMLCanvasElement | null>(null);
  const authModal = useRecoilValue(authModalState);
  

  useEffect(() => {
    let animationId: number;
    // Redirect if user is authenticated
    if (user) {
      router.push("/");
    }

    // Set page loading state
    if (!loading && !user) {
      setPageLoading(false);
    }

    // Get canvas and context
    const canvas = canvasRef.current;
    const context = canvas?.getContext("2d");

    // If canvas or context is not available, stop execution
    if (!canvas || !context) {
      return;
    }

    // Function to animate particles
    const animate = (effect: Effect) => {
      if (context && canvas) {
        context.clearRect(0, 0, canvas.width, canvas.height);
        effect.draw(context);
        effect.update();
        animationId = requestAnimationFrame(() => animate(effect));
      }
    };

    // Function to draw particles
    const drawParticles = () => {
      const effect = new Effect(canvas.width, canvas.height);
      effect.init(context);
      animate(effect);
    };

    // Function to load canvas
    const loadCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
      drawParticles();
    };

    // Resize the canvas to fill the window
    loadCanvas();

    // Resize the canvas whenever the window size changes
    window.addEventListener("load", loadCanvas);

    // Clean up the event listener when the component is unmounted
    return () => {
      cancelAnimationFrame(animationId);
      window.removeEventListener("load", loadCanvas);
    };
  }, [user, router, loading]);

  return (
    <div className="radial-gradient">
      <div className="max-w-7xl mx-auto">
        <Navbar />
        <div className="flex items-center justify-center h-[calc(100vh-5rem)] pointer-events-none select-none">
          <canvas ref={canvasRef} id="canvas" />
          <img
            src="data:image/png;base64,"
            id="image1"
          ></img>
        </div>
        {authModal.isOpen && <AuthModal />}
      </div>
    </div>
  );
};

export default AuthPage;
